import React from 'react';
import './Product.css';

const BottomProductCards = ({ products }) => {
  return (
    <div className="bottom-product-cards">
      <h2>Featured Products</h2>
      <div className="bottom-product-grid">
        {products.map(product => (
          <div key={product.id} className="bottom-product-card">
            <img src={product.imageSrc} alt={product.name} />
            <h3>{product.name}</h3>
            <p className="about">{product.about}</p>
            <p>{`$${product.price}`}</p>
            <button>Add to Cart</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default BottomProductCards;
